import {SEARCH_SUCCESS, SEARCH_FAILURE} from '../constants/ActionTypes'

export default function movies(state = [], action){
  switch (action.type) {
    case SEARCH_SUCCESS:
    return action.movies.movie_results

    case SEARCH_FAILURE:
    return state

    default:
    return state

  }
}
